import React, { useEffect, useState } from 'react'
import axios from 'axios'

const PostList = () => {
    const [posts, setPosts] = useState({})

    useEffect(() => {
        axios.get("http://localhost:4000/posts")
        .then(({data}) => setPosts(data))
    }, [])

  return (
    <>IM post list</>
  )
}

export default PostList
